@Test
  public void intoDatabaseTable_returnsNotNullValue() {
    /* Given */
    InsertOrIgnoreImpl insertOrIgnore = new InsertOrIgnoreImpl();

    /* When */
    Into result = insertOrIgnore.into("my_database", "my_table");

    /* Then */
    assertThat(result, is(notNullValue()));
  }

